  render() {
    return (
      ReactDOM.createPortal(
        <React.Fragment>
          <a ta className="github__link" href="https://github.com/Beschuetzer">
          GitHub
          </a>
        </React.Fragment>
      ,
        document.querySelector('#github')
      )
    );
  }
}

export default GithubButton;
